      <div class="app">
        <div class="scene-container">
          <div class="scene-inner">
            <div
              v-for="(item, index) in scene"
              class="symbol"
              :key="item.id"
              :style="{
                transform: `translateX(${
                  item.status === 0 ? item.x : item.status === 1 ? sortedQueue[item.id] : -1000
                }%) translateY(${item.status === 0 ? item.y : 895}%)`,
                opacity: item.status < 2 ? 1 : 0,
              }"
              @click="clickSymbol(index)"
            >
              <div
                class="symbol-inner"
                :style="{ backgroundColor: item.isCover ? '#999' : 'white' }"
              >
                <img style="width: 100%" :src="item.icon" alt="" />
